import React, {Component} from 'react';
import hacker from '../../assets/hacker.png';

import './Hacker.css';

class Hacker extends Component {
  render() {
    return (
      <div className='hacker-container'>
        <img src={hacker}></img>
      </div>
    )
  }
}

export default Hacker;
